package com.bkahlert.nebula.gallery.demoSuits.browser;

import org.eclipse.swt.SWT;
import org.eclipse.swt.events.SelectionAdapter;
import org.eclipse.swt.events.SelectionEvent;
import org.eclipse.swt.graphics.Point;
import org.eclipse.swt.widgets.Button;
import org.eclipse.swt.widgets.Composite;

import com.bkahlert.nebula.gallery.annotations.Demo;
import com.bkahlert.nebula.gallery.demoSuits.AbstractDemo;
import com.bkahlert.nebula.widgets.image.Image;
import com.bkahlert.nebula.widgets.image.Image.IImageListener;

@Demo
public class ImageDemo extends AbstractDemo {

	private Image image;

	@Override
	public void createDemo(Composite composite) {
		this.image = new Image(composite, SWT.NONE);
		// this.image.setLayoutData(new GridData(SWT.CENTER, SWT.CENTER, true,
		// false, 1, 1));
		this.image.addImageListener(new IImageListener() {
			@Override
			public void imageLoaded(Point size) {
				ImageDemo.log("Image loaded: " + size);
			}

			@Override
			public void imageResized(Point size) {
				ImageDemo.log("Image resized: " + size);
			}
		});
	}

	@Override
	public void createControls(Composite composite) {
		Button image1 = new Button(composite, SWT.PUSH);
		image1.setText("Set Image 1");
		Button image2 = new Button(composite, SWT.PUSH);
		image2.setText("Set Image 2");
		Button image3 = new Button(composite, SWT.PUSH);
		image3.setText("Set Image 3");
		Button image4 = new Button(composite, SWT.PUSH);
		image4.setText("Set Image 4");

		image1.addSelectionListener(new SelectionAdapter() {
			@Override
			public void widgetSelected(SelectionEvent e) {
				ImageDemo.this.image
						.load("data:image/jpeg;base64,%3D",
								new Runnable() {
									@Override
									public void run() {
										ImageDemo.log("loaded");
										ImageDemo.this.layout();
									}
								});
			}
		});
		image2.addSelectionListener(new SelectionAdapter() {
			@Override
			public void widgetSelected(SelectionEvent e) {
				ImageDemo.this.image
						.load("data:image/jpeg;base64,",
								new Runnable() {
									@Override
									public void run() {
										ImageDemo.log("loaded");
										ImageDemo.this.layout();
									}
								});
			}
		});
		image3.addSelectionListener(new SelectionAdapter() {
			@Override
			public void widgetSelected(SelectionEvent e) {
				ImageDemo.this.image
						.load("data:image/jpeg;base64,",
								new Runnable() {
									@Override
									public void run() {
										ImageDemo.log("loaded");
										ImageDemo.this.layout();
									}
								});
			}
		});
		image4.addSelectionListener(new SelectionAdapter() {
			@Override
			public void widgetSelected(SelectionEvent e) {
				ImageDemo.this.image
						.load("data:image/jpeg;base64,%3D",
								new Runnable() {
									@Override
									public void run() {
										ImageDemo.log("loaded");
										ImageDemo.this.layout();
									}
								});
			}
		});

	}

}
